import '../style/NonProfitsPage.css'
import { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const NonProfitsPage = () => {
    const API_URL_GET_ALL = 'http://localhost:8080/nonprofit/getAll';

    const [ nonProfitList, setNonProfitList ] = useState([]);

    const fetchNonProfitList = async () => {
        try {
            const response = await fetch(API_URL_GET_ALL);
            const info = await response.json();
            console.log(JSON.stringify(info));
            setNonProfitList(info);
        } catch (e) {
            console.error(e.stack)
        }
    }

    useEffect(() => {
        fetchNonProfitList();
    }, []);

    return (
        <div className='non-profits-main'>
            <ul className='non-profits-table'>
            <li class="table-header">
                <div class="col col-1">ID</div>
                <div class="col col-2">Name</div>
                <div class="col col-3">Email</div>
                <div class="col col-4">Address</div>
                <div class="col col-4">Total Transferred</div>
            </li>
                {nonProfitList.map((entry) => {
                    <li>
                        <Link 
                            key={entry.id}
                            to='/getOne'

                        >

                        </Link>
                    </li>
                })}
            </ul>
        </div>
    );
}

export default NonProfitsPage;
